import React from 'react';
import  {FiGithub} from 'react-icons/fi'
import {AiOutlineBell , AiOutlineBars} from 'react-icons/ai'

function Header(props) {
    return (
        <div class = "container-fluid" >
            <div class = "row" style = {{background : '#24292F' , padding : '20px'}}>
                 <div class = "col-1">
                 <AiOutlineBars  color = "white" size = "40px"/>
                 </div>
                 <div class = "col-9">
                 <FiGithub  color = "white" size = "40px"/>
                 </div>
                 <div class = "col-2 ">
                 <AiOutlineBell  color = "white" size = "40px"  style = {{alignSelf : 'flex-end'}}/>
                 </div>
             </div>     
             <div class ="row">
            </div>       
        </div>
    );
}

export default Header;
